import React from 'react';
import Name from './names';
import Plant from './plant'

function PlantMenu(plants) {
 return (
  <ul>
    {plants.map((plant) => <Plant key={plant.Name} value={plants} />)}
  </ul>
);
}

export default PlantMenu;
